import {handleAddTodo} from '../actions/todos';
export default function Todos(){
const input = React.useRef("");
const addItem=(e)=>{
e.preventDefault();
dispatch(handleAddTodo(
input.current.value,
()=>input.current.value="";
));
}
<input
ref={input}
/>
<button onClick={addItem}>Add</button>
}

